    /**
     * Gets the SVG html string forcing dark version
     * @param int|null $height
     * @param int|null $width
     * @return string
     */
    public function getDark(?string $height = null, ?string $width = null): string
    {
        $heightStr = $height ? " height=\"$height\"" : "";
        $widthStr = $width ? " width=\"$width\"" : "";

        if ($this === self::CHATBRIDGE_LOGO || $this === self::CHATBRIDGE_ICON) {
            $str = str_replace("#{theme-class}", " class=\"st16\"", $this->value);
            $str = str_replace("#{theme-value}", ".st16{fill:#333333;}", $str);
        } else {
            $str = str_replace("#{theme-class}", "", $this->value);
            $str = str_replace("#{theme-value}", " style=\"fill: #333333;\"", $str);
        }
        $str = str_replace("#{height}", $heightStr, $str);
        return str_replace("#{width}", $widthStr, $str);
    }

    /**
     * Gets the SVG html string forcing light version
     * @param int|null $height
     * @param int|null $width
     * @return string
     */
    public function getLight(?string $height = null, ?string $width = null): string
    {
        $heightStr = $height ? " height=\"$height\"" : "";
        $widthStr = $width ? " width=\"$width\"" : "";

        if ($this === self::CHATBRIDGE_LOGO || $this === self::CHATBRIDGE_ICON) {
            $str = str_replace("#{theme-class}", " class=\"st16\"", $this->value);
            $str = str_replace("#{theme-value}", ".st16{fill:#FFFFFF;}", $str);
        } else {
            $str = str_replace("#{theme-class}", "", $this->value);
            $str = str_replace("#{theme-value}", " style=\"fill: #FFFFFF;\"", $str);
        }
        $str = str_replace("#{height}", $heightStr, $str);
        return str_replace("#{width}", $widthStr, $str);
    }

    /**
     * Gets the SVG html string using global-css theme values
     * @param int|null $height
     * @param int|null $width
     * @return string
     */
    public function get(?string $height = null, ?string $width = null): string
    {
        $heightStr = $height ? " height=\"$height\"" : "";
        $widthStr = $width ? " width=\"$width\"" : "";

        $str = str_replace("#{theme-class}", " class=\"svg-text-color\"", $this->value);
        $str = str_replace("#{theme-value}", "", $str);
        $str = str_replace("#{height}", $heightStr, $str);
        return str_replace("#{width}", $widthStr, $str);
    }

    /**
     * Gets the associated URL for this svg (does not support styling).
     * @return string The URL for this svg
     */
    public function getUrl(): string
    {
        return match ($this) {
            self::CHATBRIDGE_LOGO => "https://chatbridge.app/assets/chatbridge/logo.svg",
            self::CHATBRIDGE_ICON => "https://chatbridge.app/assets/chatbridge/icon.svg",
            self::LANGUAGE => "https://chatbridge.app/assets/icons/language.svg",
            default => "https://chatbridge.app/assets/icons/no_image.svg"
        };
    }
